template <typename T, std::size_t N>
constexpr auto length_of(T (&)[N]) -> std::size_t { return N;
} This code is equivalent to making a macro to get the length of C style array. #define length_of(x) sizeof(x) / sizeof(x[0]) Usage: std::int32_t arr[] = {1, 2, 3, 4}; length_of(arr); // 4

