This template function is trying to emulate the curry technique of converting a function that takes multiple arguments into a sequence of functions that each takes a single argument. Currying - Wikipedia . template <typename callable, typename... params>
auto curry(callable f, params... ps) { if constexpr (requires { f(ps...); }) { return f(ps...); } else { return [f, ps...](auto... qs) { return curry(f, ps..., qs...); }; }
} Usage: auto fn = [](std::int32_t a, std::int32_t b) { return a + b;
}; auto crr = curry(fn, 1);
crr(2); // 3

